		var _data = {
			"badges": _badges,
			"participantTokens": _tokens,
			"upload": false,
			"eventName": "front",
			"userIdentifier": "prod"
		}

		$.ajax({
			type: "POST",
			url: "http://localhost:3000/build",
			data: JSON.stringify(_data),
			contentType: "application/json",
			dataType: "json",
			success: async function (response) {
				if (response.status == 'success') {

					if(response.file){
						const r = await fetch(response.file);
						const blob = await r.blob();
						const url = URL.createObjectURL(blob);
						$('#file').attr('src', url);
					}
					else{
						$('#file').attr('src', response.url);
					}
				}
			}
		});
	</script>
